from collections import deque


class Solution:
    class MyDict(dict):
        def remove(self, key):
            if self[key] == 1:
                self.pop(key)
            else:
                self[key] -= 1

        def add(self, key):
            if self.get(key, False):
                self[key] += 1
            else:
                self[key] = 1

    def string_to_map(self, s):
        result = self.MyDict()
        for c in s:
            result[c] = result[c] + 1 if result.get(c, False) else 1
        return result

    def checkInclusion(self, s1: str, s2: str) -> bool:
        i = 0
        chars_list = deque()
        chars_map = self.string_to_map(s1)
        while i < len(s2):
            if s2[i] in chars_map:
                chars_map.remove(s2[i])
                chars_list.append(s2[i])
                i += 1
            else:
                if len(chars_list):
                    chars_map.add(chars_list.popleft())
                else:
                    i += 1
            if len(chars_map) == 0:
                return True

        return False

    def checkInclusion1(self, s1: str, s2: str) -> bool:
        is_permutation = False

        for i in range(len(s2)):
            is_permutation = False
            if len(s2) - i < len(s1):
                break
            for c in s2[i : i + len(s1)]:
                if c in s1 and not is_permutation:
                    s1_map = self.string_to_map(s1)
                    s1_map.remove(c)
                    is_permutation = True
                elif is_permutation and c in s1_map:
                    s1_map.remove(c)
                else:
                    break

                if is_permutation and len(s1_map) == 0:
                    return True
        return False


